import "./App.css";
import NavAll from "./nav";
import Footer from "./footer";
import Sevices from "./services";
import AppSS from "./train";

function App() {
  return (
    <div className="App">
      <NavAll />
      <AppSS />
      <Sevices />
      <Footer />
    </div>
  );
}

export default App;
